import React from "react";
import { Col, Row } from "react-bootstrap";

export const LojaFilter = () => {
  return (
    <div className="bodie">
      <Row className="justify-content-center align-content-start">
        <Col xs={11}></Col>
      </Row>
    </div>
  );
};
